import React from "react";
import styled from "styled-components";

const NavbarTemplate = styled.div`
  max-width: 1280px;
  margin: 0 auto;
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding-left: 40px;
  padding-right: 40px;
  z-index: 3;
  background: #fff;
`;

const NavECText = styled.span`
  display: inline-block;
  font-size: 1.5rem;
  color: #101010;
  font-weight: bold;
  white-space: nowrap;
`;

const NavMenu = styled.ul`
  padding: 0;
  margin: 0;
  display: flex;
  list-style: none;
  li:not(:nth-child(1)) {
    padding-left: 32px;
  }
  li:nth-child(4) {
    opacity: 0.2;
  }
`;

const NavMenuText = styled.li`
  a {
    text-decoration: none;
  }
`;

function Main_Navbar() {
  return (
    <NavbarTemplate>
      <NavECText>Endless Creation</NavECText>
      <NavMenu>
        <NavMenuText>
          <a href="#">Activity</a>
        </NavMenuText>
        <NavMenuText>
          <a href="#">Project</a>
        </NavMenuText>
        <NavMenuText>
          <a href="#">Member</a>
        </NavMenuText>
        <NavMenuText>
          <a href="#">community</a>
        </NavMenuText>
      </NavMenu>
    </NavbarTemplate>
  );
}

export default Main_Navbar;
